import { Bar } from "react-chartjs-2";

const BarChart = ({ data }) => {
  const chartData = {
    labels: data.map((item) => item.Day),
    datasets: [
      {
        label: "Feature A",
        data: data.map((item) => parseInt(item.A)),
        backgroundColor: "rgba(75, 192, 192, 0.6)",
      },
    ],
  };

  return <Bar data={chartData} />;
};

export default BarChart;
